import React from "react";
import "./Users.css";

const Users = () => {
    return (
        <div className="flex-container">
            <div class="main">
                <form>
                    <div class="flex-item">
                        <label>Username</label>
                        <input />
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Users;
